    false,nt"url": null,nt"notes": "This annual narrative report for Medicine
    Lake National Wildlife Refuge, Northeast Montana Wetland Management District, Lamesteer
    National Wildlife Refuge outlines Refuge accomplishments during the 1995 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Planning is dicussed; topics include management plans and compliance with environmental
    and cultural resource mandates. Refuge administration is outlined; information about
    personnel, youth programs, volunteer programs, funding, safety, technical assistance,
    and training is given. Habitat management is also covered; subjects include wetlands,
    forests, croplands, grasslands, other habitats, grazing, fire management, pest control,
    water rights, and wilderness areas. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, other migratory birds, game mammals, other resident
    wildlife, fisheries resources, animal control, marking and bird banding, and disease
    prevention and control. The public uses of the Refuge described in this report include
    interpretive programs, hunting, fishing, trapping, wildlife observation, picnicking,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    utilization and replacement, communications systems, computer systems, and energy
    conservation. Cooperative programs are discussed.",nt"license_title": "License
